import React from 'react';
import './App.css';

class Card extends React.Component {
    render() {
        return (
            <div className="card">
                {this.props.img()}
            </div>
        );
    }
}

class Board extends React.Component {
    render() {
        const cards = [];

        for (i = 0; i <= 16; i++) {
            cards.push(<Card img={this.imageCard} />)
        }

        return (
            <div className="board">
                
            </div>
        )

        return (
            <div className="board">
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
                <Card img={this.imageCard}/>
            </div>
        );
    }

    imageCard() {
        return <img src="img/angular.svg" alt="Angular"/>
    }
}


function App() {
  return (
    <div className="App">
      <Board/>
    </div>
  );
}

export default App;
